import { useState } from "react";
import { DndProvider, useDrag, useDrop } from "react-dnd";
import { HTML5Backend } from "react-dnd-html5-backend";
import Card from '../components/ui/Card';
import Button  from '../components/ui/Button';
import Input from '../components/ui/Input';
import { Select, SelectItem } from "../components/ui/Select";

const Task = ({ task, index, moveTask, updateStatus }) => {
    const [, ref] = useDrag({
        type: "TASK",
        item: { index },
    });

    const [, drop] = useDrop({
        accept: "TASK",
        hover: (draggedItem) => {
            if (draggedItem.index !== index) {
                moveTask(draggedItem.index, index);
                draggedItem.index = index;
            }
        },
    });

    return (
        <Card ref={(node) => ref(drop(node))} className="p-4 mb-2 shadow-md">
            <CardContent>
                <p className="text-lg font-semibold">{task.title}</p>
                <p className="text-sm">Deadline: {task.deadline}</p>
                <p className="text-sm">Priority: {task.priority}</p>
                <p className="text-sm">Assigned to: {task.assignee}</p>
                <Select value={task.status} onChange={(e) => updateStatus(index, e.target.value)}>
                    <SelectItem value="Pending">Pending</SelectItem>
                    <SelectItem value="In Progress">In Progress</SelectItem>
                    <SelectItem value="Done">Done</SelectItem>
                </Select>
            </CardContent>
        </Card>
    );
};

export default function TodoApp() {
    const [tasks, setTasks] = useState([]);
    const [newTask, setNewTask] = useState({ title: "", deadline: "", priority: "Low", assignee: "", status: "Pending" });

    const addTask = () => {
        if (newTask.title.trim()) {
            setTasks([...tasks, newTask]);
            setNewTask({ title: "", deadline: "", priority: "Low", assignee: "", status: "Pending" });
        }
    };

    const moveTask = (fromIndex, toIndex) => {
        const updatedTasks = [...tasks];
        const [movedTask] = updatedTasks.splice(fromIndex, 1);
        updatedTasks.splice(toIndex, 0, movedTask);
        setTasks(updatedTasks);
    };

    const updateStatus = (index, status) => {
        const updatedTasks = [...tasks];
        updatedTasks[index].status = status;
        setTasks(updatedTasks);
    };

    return (
        <DndProvider backend={HTML5Backend}>
            <div className="p-6 max-w-xl mx-auto">
                <h1 className="text-2xl font-bold mb-4">Family TODO List</h1>
                <div className="mb-4 grid grid-cols-1 gap-2">
                    <Input placeholder="Task Title" value={newTask.title} onChange={(e) => setNewTask({ ...newTask, title: e.target.value })} />
                    <Input type="date" value={newTask.deadline} onChange={(e) => setNewTask({ ...newTask, deadline: e.target.value })} />
                    <Select value={newTask.priority} onChange={(e) => setNewTask({ ...newTask, priority: e.target.value })}>
                        <SelectItem value="Low">Low</SelectItem>
                        <SelectItem value="Medium">Medium</SelectItem>
                        <SelectItem value="High">High</SelectItem>
                    </Select>
                    <Input placeholder="Assign to" value={newTask.assignee} onChange={(e) => setNewTask({ ...newTask, assignee: e.target.value })} />
                    <Button onClick={addTask}>Add Task</Button>
                </div>
                <div>
                    {tasks.map((task, index) => (
                        <Task key={index} task={task} index={index} moveTask={moveTask} updateStatus={updateStatus} />
                    ))}
                </div>
            </div>
        </DndProvider>
    );
}
